// src/pages/Dashboard.js
import React, { useEffect, useState } from "react";
import { fetchContributions } from "../services/githubService";

const Dashboard = () => {
  const [contributions, setContributions] = useState([]);

  useEffect(() => {
    const organization = process.env.REACT_APP_ORG_NAME;
    fetchContributions(organization).then((data) => setContributions(data));
  }, []);

  return (
    <div>
      <h1>GitHub Contributions Dashboard</h1>
      {contributions.length === 0 ? (
        <p>Loading contributions...</p>
      ) : (
        <ul>
          {contributions.map((contrib, index) => (
            <li key={index}>
              {contrib.login} - {contrib.contributions} contributions
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Dashboard;
